import { useEffect } from 'react';
import QuoteList from '../components/quotes/QuoteList';
import useHttp from '../hooks/use-http';
import { getAllQuotes } from '../lib/api';
import NoQuotesFound from ''
const  DUMMY_LIST =[
    {id:'q1' , auther:'Max' , text:'LEarn React By Fan.'},
    {id:'q2' , auther:'Enas' , text:'LEarn React By Great.'},
];
const AllQuouts=()=>{
    const {sendRequest ,status ,error ,data:LoadedQuote}=useHttp(getAllQuotes,true);

    useEffect(()=>{
        sendRequest();
    },[sendRequest]);

    
  if (status === 'pending') {
    return (
      <div className='centered'>
        <LoadingSpinner />
      </div>
    );
  }

  if (error) {
    return <p className='centered focused'>{error}</p>;
  }

  if (status === 'completed' && (!LoadedQuote || LoadedQuote.length === 0)) {
    return <NoQuotesFound />;
  }
    return <QuoteList quotes={LoadedQuote}/>
}
export default AllQuouts;
